Let's take a look at Repeat iterator: #pragma once #include "CoreMinimal.h" // Make sure to include converters declaration header first.
#include "Systems/Public/Iterator/ConvertersDecl.h" // Then converters, macros and size hint, order doesn't matter here.
#include "Systems/Public/Iterator/Converters.h"
#include "Systems/Public/Iterator/Macros.h"
#include "Systems/Public/Iterator/SizeHint.h" // This iterator is generalized over type of values it yields.
template <typename T>
struct TIterRepeat
{
public: // We need to provide type aliases for iterators injected with macros will // properly understand this iterato when wrapping it internally. using Self = TIterRepeat<T>; using Item = typename T; TIterRepeat() : Value(TOptional<T>()) { } TIterRepeat(T Data) : Value(TOptional<T>(Data)) { } // Provide `Next` method that returns optional value of item type. TOptional<Item> Next() { return TOptional<T>(this->Value); } // Provide `Sizehint` method thar returns hint about estimated range of // items it can yield. IterSizeHint SizeHint() const { return IterSizeHint{0, TOptional<uint32>()}; } private: TOptional<T> Value = {}; public: // To make iterators chains we call special macro that injects all other // built-in iterators as this one methods. ITER_IMPL
}; // Provide handy construction function for ergonomics, just because of C++
// having easier times with types deduction on them.
template <typename T>
TIterRepeat<T> IterRepeat(T Value)
{ return TIterRepeat<T>(Value);
} Self type alias Iterators chaining is done by wrapping consecutive iterators in one another so when consumer calls Next, it internally calls Next of iterator it wraps, and so on. To make them easily injectable with macros, they use Self as an alias for their type. Item type alias Type alias for type of value that this iterator yields. Not stores, not takes as an input - exactly one that it yields. This is again used for iterators wrapping purposes so converter iterators that wraps other iterators can identify value type of previous one in chain by typename ITERATOR::Item. Next method Every iterator should implement TOptional<Item> Next() method. This method does the actual job of yielding a value. See TQuery::Next . SizeHint method. Size hints are used by for example collector iterators to estimate the capacity of collection where yielded data will be stored. This at most removes reallocations when adding every next value into that collection, and at least reduces it to some reasonable number. Finite iterators will give lower bounds and upper bounds set, infinite iterators will give only lower bounds. See TQuery::SizeHint , IterSizeHint . ITER_IMPL macro This macro injects other iterators as methods of this one. Without it user would be left with ugly iterators chains made by passing next stages as argument to iterator functions/constructors.

